import {Provider, useSelector, useDispatch} from 'react-redux';
import store from './redux/store';
import Counter from './pages/toolkitPage';

function ToolkitPage() {
  return (
    <Provider store={store}>
      <div className="App">
        <Counter />
      </div>
    </Provider>
  );
}

export default ToolkitPage;
